def compositionk(text, k):
    """
    This function takes a text, then returns all compositions of k length ordered alphabetically
    :param text: the gene string
    :param k: length of substring wanted
    :return: a list of ordered substrings from the string
    """
    return sorted([text[i: i + k] for i in range(len(text) - k + 1)])


if __name__ == '__main__':
    print('\n'.join(compositionk("", 100)))